import characters from '../db/Character/Character';

function List(props) {
  return <p>{ props.id }</p>;
}

function Character() {

  return (
    <>
      <h1>List of Charac</h1>
      <ul>
        <characters />
        {characters.map((i) => <List key={i.id} id={i.id} />)}
      </ul>
    </>
  );
}
export default Character;
